/**
 * Setting Abm.DEV_MODE to true causes the Chrome desktop browser to use the File System API
 * to manage the configuration data. Using the File System emulates the operation of the mobile
 * device in the native environment.
 * Set this value to false in production environments so the Chrome browser will use local storage
 * to maintain the configuration information.
 *
 */

/* jshint -W079 */
var Abm = Abm || {};
Abm.DEV_MODE = true;

var device = {};

(function initPhonegapStub() {

    var phoneGapStubData = {};

    // Phonegap device API stubs
    device.uuid = '46FB6E5A-9A61-4C53-838D-F2521618A1AA';
    device.name = 'Browser';
    device.version = '0.01';

    phoneGapStubData.camera = {};

    phoneGapStubData.appData = [
        {
            name: 'Maintenance',
            pictureBase64: ""
        },
        {
            name: 'ConditionAssessment',
            pictureBase64: ""
        },
        {
            name: 'IncidentReporting',
            pictureBase64: ""
        },
        {
            name: 'AssetAndEquipmentSurvey',
            pictureBase64: ""
        },
        {
            name: 'SpaceOccupancy',
            pictureBase64: ""
        }
    ];

    var getImageByAppName = function (appName) {
        var imageData = '',
            i;

        for (i = 0; i < phoneGapStubData.appData.length; i++) {
            if (appName === phoneGapStubData.appData[i].name) {
                imageData = phoneGapStubData.appData[i].pictureBase64;
            }
        }

        // Default image if app is not included
        if (imageData === '') {
            imageData = phoneGapStubData.appData[0].pictureBase64;
        }

        return imageData;
    };
    //
    // Camera API - http://docs.phonegap.com/cordova_camera_camera.md.html
    navigator.camera = {
        getPicture: function (cameraSuccess, cameraError, cameraOptions) {
            var appName = '',
                imageData;

            // cameraOptions contains an additional property of applicationName that is used to
            // provide application specific images
            if (cameraOptions && cameraOptions.applicationName) {
                appName = cameraOptions.applicationName;
            }
            imageData = getImageByAppName(appName);
            if (cameraOptions && cameraOptions.destinationType !== undefined &&
                cameraOptions.destinationType === navigator.camera.DestinationType.FILE_URI) {
                cameraSuccess(imageData);
            } else {
                if (cameraOptions.encodingType === navigator.camera.EncodingType.PNG) {
                    cameraSuccess(imageData);
                } else {
                    cameraSuccess(imageData);
                }
            }
        },

        // Constants used for camera options
        DestinationType: {
            DATA_URL: 0, // Return base64 encoded string
            FILE_URI: 1
            // Return file uri (content://media/external/images/media/2 for Android)
        },
        PictureSourceType: {
            PHOTOLIBRARY: 0,
            CAMERA: 1,
            SAVEDPHOTOALBUM: 2
        },
        EncodingType: {
            JPEG: 0, // Return JPEG encoded image
            PNG: 1
            // Return PNG encoded image
        },
        MediaType: {
            PICTURE: 0, // allow selection of still pictures only. DEFAULT. Will return format specified via
            // DestinationType
            VIDEO: 1, // allow selection of video only, WILL ALWAYS RETURN FILE_URI
            ALLMEDIA: 2
            // allow selection from all media types
        }
    };

    // Constants seem to be defined for navigator.camera and Camera
    Camera = navigator.camera;

    // Connection
    window.Connection = {
        ETHERNET: "ethernet",
        WIFI: "wifi",
        CELL_2G: "2g",
        CELL_3G: "3g",
        CELL_4G: "4g",
        NONE: "none"
    };

    window.navigator.network = {};
    window.navigator.network.connection = {};
    window.navigator.network.connection.type = Connection.ETHERNET;

})();


